import Expenses from "./components/Expenses"
import "./components/Expenses.css";

function App() {

  const expenses = [
    { name: "insurance", price: 200, date: new Date(2021, 7, 13) },
    { name: "petrol", price: 100, date: new Date(2021, 7, 12) },
    { name: "service", price: 300, date: new Date(2021, 7, 11) },
  ];

  return (
    <div>
      <h2>Expense Tracker</h2>

      <Expenses className="expenses" expenseList={expenses}/>

    </div>
  );
}

export default App;
